  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:55.982685\",\n\t\"name\": \"tualatin-river-wet-prairie-restoration-phase-iii\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Forty five acres of wet prairie and 11
  acres of adjacent lands were treated for reed canarygrass in this ongoing project.
  Federally threatened Nelsonu2019s checker-mallow plants that were removed from the
  site and stored at the beginning of the project were replanted following treatment,
  and additional native plant seed was planted to both restore prairie species and
  crowd out invasive reed canarygrass. The 11 acres of adjacent land was treated to
  prevent reinfestation of reed canarygrass into the wet prairie and to provide pretreatment
  for scrub shrub wetland restoration. Refuge funding was used to install native grass
  seed, and Metro provided an additional generous donation of prairie plant seed that
  was installed as well. Bonneville Power Administration funded additional contract
  labor for mowing and herbicide application.\",\n\t\"license_title\": \"License Not
